member.remarks:
Below is the JSON schema for the request and response payloads.
Request Body:
Schema for TestRunModel: { testRunId: string, # Optional. Unique test run name as identifier. displayName: string, # Optional. Display name of a test run. testId: string, # Optional. Associated test Id. resourceId: string, # Optional. Load test resource Id. description: string, # Optional. The test run description. status: string, # Optional. The test run status. startDateTime: string (ISO 8601 Format), # Optional. The test run start DateTime(ISO 8601 literal format). endDateTime: string (ISO 8601 Format), # Optional. The test run end DateTime(ISO 8601 literal format). loadTestConfig: { engineInstances: number, # Optional. The number of engine instances to execute load test. Supported values are in range of 1-45. Required for creating a new test. splitAllCSVs: boolean, # Optional. Whether all the input CSV files should be split evenly across all engines. }, # Optional. The load test configuration. testResult: string, # Optional. Test result for pass/Fail criteria used during the test run. possible outcome - ‘Passed’ , ‘Failed’ , ‘Not Applicable’. passFailCriteria: { passFailMetrics: Dictionary<string, PassFailMetric>, # Optional. Map of id and pass fail metrics { id : pass fail metrics }. }, # Optional. Pass fail criteria for a test. testArtifacts: { inputArtifacts: { configUrl: { url: string, # Optional. File URL. fileId: string, # Optional. File unique identifier. filename: string, # Optional. Name of the file. fileType: "0" | "1" | "2", # Optional. Integer representation of the file type (0 = JMX_FILE, 1 = USER_PROPERTIES, 2 = ADDITIONAL_ARTIFACTS) expireTime: string (ISO 8601 Format), # Optional. Expiry time of the file validationStatus: string, # Optional. Validation status of the file }, # Optional. FileUrl Model. testScriptUrl: FileUrl, # Optional. FileUrl Model. userPropUrl: FileUrl, # Optional. FileUrl Model. inputArtifactsZipFileurl: FileUrl, # Optional. FileUrl Model. additionalUrls: [FileUrl], # Optional. The input artifacts file { name : url } map for the test run. }, # Required. The input artifacts for the test. outputArtifacts: { resultUrl: FileUrl, # Optional. FileUrl Model. logsUrl: FileUrl, # Optional. FileUrl Model. }, # Optional. The output artifacts for the test run. }, # Optional. executedDateTime: string (ISO 8601 Format), # Optional. Test run initiated time vusers: number, # Optional. Number of virtual users, for which test has been run. testRunStatistics: Dictionary<string, TestRunStatisticsModel>, # Optional. Test run statistics createdDateTime: string (ISO 8601 Format), # Optional. The created DateTime(ISO 8601 literal format) of the test run. createdBy: string, # Optional. The user that created the test run. lastModifiedDateTime: string (ISO 8601 Format), # Optional. The last updated DateTime(ISO 8601 literal format) of the test run. lastModifiedBy: string, # Optional. The user that updated the test run. portalUrl: string, # Optional. Portal url. secrets: Dictionary<string, SecretMetadata>, # Optional. Secrets can be stored in an Azure Key Vault or any other secret store. If the secret is stored in an Azure Key Vault, the value should be the secret identifier and the type should be AKV_SECRET_URI. If the secret is stored elsewhere, the secret value should be provided directly and the type should be SECRET_VALUE. environmentVariables: Dictionary<string, string>, # Optional. Environment variables which are defined as a set of <name,value> pairs. duration: number, # Optional. Test run duration in milliseconds. subnetId: string, # Optional. Subnet ID on which the load test instances should run. }
Response Body:
Schema for TestRunModel: { testRunId: string, # Optional. Unique test run name as identifier. displayName: string, # Optional. Display name of a test run. testId: string, # Optional. Associated test Id. resourceId: string, # Optional. Load test resource Id. description: string, # Optional. The test run description. status: string, # Optional. The test run status. startDateTime: string (ISO 8601 Format), # Optional. The test run start DateTime(ISO 8601 literal format). endDateTime: string (ISO 8601 Format), # Optional. The test run end DateTime(ISO 8601 literal format). loadTestConfig: { engineInstances: number, # Optional. The number of engine instances to execute load test. Supported values are in range of 1-45. Required for creating a new test. splitAllCSVs: boolean, # Optional. Whether all the input CSV files should be split evenly across all engines. }, # Optional. The load test configuration. testResult: string, # Optional. Test result for pass/Fail criteria used during the test run. possible outcome - ‘Passed’ , ‘Failed’ , ‘Not Applicable’. passFailCriteria: { passFailMetrics: Dictionary<string, PassFailMetric>, # Optional. Map of id and pass fail metrics { id : pass fail metrics }. }, # Optional. Pass fail criteria for a test. testArtifacts: { inputArtifacts: { configUrl: { url: string, # Optional. File URL. fileId: string, # Optional. File unique identifier. filename: string, # Optional. Name of the file. fileType: "0" | "1" | "2", # Optional. Integer representation of the file type (0 = JMX_FILE, 1 = USER_PROPERTIES, 2 = ADDITIONAL_ARTIFACTS) expireTime: string (ISO 8601 Format), # Optional. Expiry time of the file validationStatus: string, # Optional. Validation status of the file }, # Optional. FileUrl Model. testScriptUrl: FileUrl, # Optional. FileUrl Model. userPropUrl: FileUrl, # Optional. FileUrl Model. inputArtifactsZipFileurl: FileUrl, # Optional. FileUrl Model. additionalUrls: [FileUrl], # Optional. The input artifacts file { name : url } map for the test run. }, # Required. The input artifacts for the test. outputArtifacts: { resultUrl: FileUrl, # Optional. FileUrl Model. logsUrl: FileUrl, # Optional. FileUrl Model. }, # Optional. The output artifacts for the test run. }, # Optional. executedDateTime: string (ISO 8601 Format), # Optional. Test run initiated time vusers: number, # Optional. Number of virtual users, for which test has been run. testRunStatistics: Dictionary<string, TestRunStatisticsModel>, # Optional. Test run statistics createdDateTime: string (ISO 8601 Format), # Optional. The created DateTime(ISO 8601 literal format) of the test run. createdBy: string, # Optional. The user that created the test run. lastModifiedDateTime: string (ISO 8601 Format), # Optional. The last updated DateTime(ISO 8601 literal format) of the test run. lastModifiedBy: string, # Optional. The user that updated the test run. portalUrl: string, # Optional. Portal url. secrets: Dictionary<string, SecretMetadata>, # Optional. Secrets can be stored in an Azure Key Vault or any other secret store. If the secret is stored in an Azure Key Vault, the value should be the secret identifier and the type should be AKV_SECRET_URI. If the secret is stored elsewhere, the secret value should be provided directly and the type should be SECRET_VALUE. environmentVariables: Dictionary<string, string>, # Optional. Environment variables which are defined as a set of <name,value> pairs. duration: number, # Optional. Test run duration in milliseconds. subnetId: string, # Optional. Subnet ID on which the load test instances should run. }

